import { Injectable } from '@angular/core';

@Injectable()
export class MyCalculatorService {

  addition(inputValue1: Number, inputValue2:Number): Number{
    return Number(inputValue1)+Number(inputValue2); 

  }

  subtraction(inputValue1: Number, inputValue2:Number): Number{
    return Number(inputValue1)-Number(inputValue2); 
  }

  division(inputValue1: Number, inputValue2:Number): Number{
   return Number(inputValue1)/Number(inputValue2); 

  }

  multiplication(inputValue1: Number, inputValue2:Number): Number{
   return Number(inputValue1)*Number(inputValue2); 
 }

}
